// src/components/Navbar.js

import React from 'react';
import { Link } from 'react-router-dom';  // Import Link from react-router-dom

const Navbar = () => {
  return (
    <nav>
      <ul style={{ listStyleType: 'none', padding: 0 }}>
        <li style={{ display: 'inline', marginRight: '15px' }}>
          <Link
            to="/"
            style={{
              textDecoration: 'none', 
              color: 'black',  // Change color for the Home link
            }}
          >
            Home
          </Link>
        </li>
        <li style={{ display: 'inline', marginRight: '15px' }}>
          <Link
            to="/login"
            style={{
              textDecoration: 'none',
              color: 'black',
            }}
          >
            Login
          </Link>
        </li>
        <li style={{ display: 'inline', marginRight: '15px' }}>
          <Link
            to="/register"
            style={{
              textDecoration: 'none',
              color: 'black',
            }}
          >
            Register
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
